INSERT [dbo].[Product] ([ProductId], [ProductName], [Sku], [Price], [PriceSaleOff], [Material], [Description], [IsDeleted]) VALUES (868, N'Áo phông trẻ em unisex hình in Mickey', N'3TS21S002', 169000, 0, N'100% cotton', N'Áo phông chất liệu cotton USA . Dáng unisex, cổ tròn, tay cộc. Số lượng giới hạn. . HÌNH IN BẢN QUYỀN DISNEY GỒM 2 PHIÊN BẢN. Phiên bản lấy cảm hứng từ bức tranh Đông Hồ nổi tiếng “Mục đồng thổi sáo” mang ý nghĩa ca ngợi người nông dân vừa siêng năng lao động vừa biết sáng tạo nghệ thuật, Canifa và Mickey go Vietnam mang một diện mạo mới, thân thuộc hơn. Bức tranh thể hiện tinh thần vui tươi lạc quan, gần gũi với thiên nhiên, văn hóa và con người Việt Nam.. . Phiên bản ấy cảm hứng từ bức tranh Đông Hồ nổi tiếng “Hứng dừa” đề cao sự cảm thông, chia sẻ và gắn bó của vợ chồng, cha con để xây dựng hạnh phúc gia đình, Mickey go Vietnam mang một ý nghĩa mới về tình bạn thân thiết giữa Mickey và Minnie, Donald, Daisy khi trải nghiệm văn hóa Việt Nam.', 0)
